import React from 'react';

const HouseOfModels = () => {
  return (
    <div className="relative bg-black">
   
    <div className="container mx-auto px-4 pt-24 pb-16 text-center relative z-10">
      <h2 className="text-2xl font-medium text-pink-300">House of Models Library</h2>
      <h1 className="text-5xl font-extrabold text-white mt-4">Under the hood</h1>
      <p className="mt-6 text-lg font-light text-gray-400">
        Site Builder utilizes a built-in design system and component library of 1000+ components made for Figma & Webflow.
      </p>
    </div>
  
  </div>
  );
};

export default HouseOfModels;
